            <div class="clearfix text-formatted field field--name-body field--type-text-with-summary field--label-hidden field__item"><h2 class="heading--underline">Perks of working at UC Davis</h2>

<p>UC Davis was named one of <a href="https://hr.ucdavis.edu/news/uc-davis-best-large-employer-2019">Americaâ€™s best large employers by Forbes</a>Â in 2023 forÂ the tenth year in a row. TheÂ university has been honored for our range of employee benefits, including extras and work-life initiatives that go beyond salary to create a positive work environment. Hereâ€™s why you should work for UC Davis:</p>

<h3>Health care</h3>

<p>For most employees working 50 percentÂ or more time, youâ€™re offered:</p>

<ul><li><strong><a href="http://www.hr.ucdavis.edu/benefits/health_and_welfare/medical/index.html">Medical and behavioral health</a></strong>Â Â Â  Â <br />
	Choice of options depending on your address, including HMO, PPO or PPO with a health savings account. You may enroll your spouse, domestic partner, children and grandchildren (biological or adopted, stepchildren, domestic partnerâ€™s children)Â and legal ward.</li>
	<li><strong><a href="http://www.hr.ucdavis.edu/benefits/health_and_welfare/medical/vision.html">Vision</a></strong>Â Â  Â <br />
	The UC Davis plan covers many vision care services, including eye exams, corrective lenses and frames.</li>
	<li><strong><a href="http://www.hr.ucdavis.edu/benefits/health_and_welfare/medical/dental.html">Dental</a></strong><br />
	The UC Davis plan offers coverage through a PPO or HMO. Both options cover preventative, basic and prostheticÂ dentistry, and orthodontics.</li>
</ul><h3>Time off</h3>

<p>For most employees working 50 percentÂ or more time, youâ€™re offered:</p>

<ul><li><strong>Paid sick leave</strong>. 12 days per calendar year.</li>
	<li><strong>Paid holidays.Â </strong>13 days per calendar year.</li>
	<li><strong>Paid vacation.Â </strong>Starting at 15 and reaching 24 days per calendar year. The amount you accrue depends on the number of your monthly working hours.</li>
</ul><h3>Retirement</h3>

<p>TheÂ <a href="http://www.hr.ucdavis.edu/benefits/retirement/index.html">UC retirement plan</a>Â is a comprehensive array of retirement benefits, savings programs and educational and counseling resources. It also offers additional, convenient ways to save beyond the program, includingÂ <strong>tax-deferred 403(b), 457(b) Deferred Compensation Plan and Defined Contribution Plan</strong>.</p>

<h4>More Information</h4>

<ul><li><a href="http://www.hr.ucdavis.edu/benefits/index.html">Human Resources Benefits website</a></li>
	<li><a href="http://ucnet.universityofcalifornia.edu/forms/pdf/complete-health-benefits-guide-for-employees.pdf">Full explanations in the UC Employee Benefits Guide</a></li>
	<li><a href="https://shcs.ucdavis.edu/insurance/ship-benefits-information">Student staff health insurance information</a></li>
</ul><h3>Additional Benefits</h3>

<div class="media media--type-sf-image-media-type media--view-mode-default">
  
          <img loading="lazy" src="/sites/default/files/media/images/uc-davis-benefits-wellness.jpg" width="1000" height="432" alt="Man on a treadmill. " typeof="foaf:Image" /></div>
<p>Â </p>

<p>As an employee of UC Davis, you can enjoy cultural, intellectual and physical fitness benefits that complement your paycheck in a big way.</p>

<h4>Wellness</h4>

<ul><li>Staff can accessÂ state-of-the-art exercise equipment, group fitness classes, climbing wall, running track and ball courts, swimming pools, intramural sports programs, craft classes, equestrian center, outdoor adventures and youth programs with anÂ <a href="https://cru.ucdavis.edu/content/12-join-the-arc-cru-membership.htm">Activities and Recreation Center membership</a>.</li>
	<li>Faculty and staff can participate in theÂ <a href="http://safetyservices.ucdavis.edu/article/staff-and-faculty-health-and-well-being-program">Health and Well-being Program</a>Â to socialize and practice weight management, mindfulness and meditation, art and more.</li>
	<li>Faculty can participate in theÂ <a href="https://academicaffairs.ucdavis.edu/programs/work-life/index.html">WorkLife</a>Â Program for community and resources, including professional development, elder careÂ and childcare options.</li>
</ul><h4>Workplace Flexibility</h4>

<div class="media media--type-sf-image-media-type media--view-mode-default">
  
          <img loading="lazy" src="/sites/default/files/media/images/uc-davis-benefits-childcare.jpg" width="1000" height="432" alt="Woman laughs with a child in a hospital " typeof="foaf:Image" /></div>
<p>Â </p>

<p>Many units have informal systems that support flexibility on an occasional basis, such asÂ <a href="http://worklife-wellness.ucdavis.edu/workplaceflexibility/compressedworkweek.html">compressed workweek</a>,Â <a href="http://worklife-wellness.ucdavis.edu/workplaceflexibility/flextime.html">flextime</a>Â andÂ <a href="http://worklife-wellness.ucdavis.edu/workplaceflexibility/telecommuting.html">telework</a>.</p>

<h4>Family Care Resources</h4>

<p>UC Davis provides access to prescreenedÂ <a href="http://worklife-wellness.ucdavis.edu/family_care/children/childcareoptions.html">caregivers</a>, pet sitters, tutorsÂ and other family services. Â </p>

<h4>Tax-Savings Programs</h4>

<ul><li>Health Flexible Spending Account (HSA) and Dependent Care Flexible Spending Account (FSA) benefits lower your taxable income by allowing payment for eligible expenses on a pretax basis. Some medical plans also offer Tax Savings on Insurance Premium (TIP) options.</li>
	<li>Transportation subsidies through theÂ <a href="http://goclub.ucdavis.edu/">goClub</a>Â allow pretax payroll deductions for purchasing discounted regional bus, train, carpool and vanpool passes.</li>
</ul><h4>Tuition Assistance &amp; Professional Development</h4>

<div class="media media--type-sf-image-media-type media--view-mode-default">
  
          <img loading="lazy" src="/sites/default/files/media/images/uc-davis-benefits-scholarships.jpg" width="1000" height="432" alt="Woman wearing glasses smiles in a classroom. " typeof="foaf:Image" /></div>
<ul><li>Eligible UC Davis staff can receive 20 percentÂ off atÂ <a href="https://extension.ucdavis.edu/open-campus">Open Campus</a>Â courses.</li>
	<li>The UC DavisÂ <a href="http://staff.ucdavis.edu/staffawards/staff_scholarships.html">Staff Scholarship Program</a>Â awards funding for eligible staff to pursue professional certificates as well as Associate, Bachelor or graduate degrees at community colleges, state colleges, universities and professional schools.</li>
	<li>The UC DavisÂ <a href="https://staff.ucdavis.edu/staff-awards/staff-dependent-scholarship-program">Staff Dependent Scholarship Program</a>Â awards funding for dependents of eligible staff who are attending UC Davis as undergraduate students.</li>
	<li>The UC Davis Graduate School of ManagementÂ <a href="https://gsm.ucdavis.edu/post/uc-davis-staff-mba-scholarship-program">Staff MBA Scholarship Program</a>Â awardsÂ a significant scholarship to eligible staff for the Sacramento or Bay Area Part-time MBA programs.</li>
	<li><a href="http://sdps.ucdavis.edu/index.html">Staff Development and Professional Services</a>Â on the Davis campus and Training and DevelopmentÂ on the Sacramento campus offer courses, programs,Â certificate series, mentoring, confidential career counseling, online toolkitsÂ and more.</li>
</ul><h4>Merchandise and Services Discounts</h4>

<div class="media media--type-sf-image-media-type media--view-mode-default">
  
          <img loading="lazy" src="/sites/default/files/media/images/uc-davis-benefits-discounts.jpg" width="1000" height="432" alt="People talking around MacBooks. " typeof="foaf:Image" /></div>
<p>Â </p>

<p>A membership in theÂ <a href="https://staff.ucdavis.edu/pin-program-discounts">Pin Program</a>Â provides a 10 percent discount on services in education, technology, entertainment and health, including Apple, Dell, AT&amp;T, Verizon, Sprint, Starbucks, massage therapy, auto repair, fitness clubs, and UC Davis gifts and clothing. All UC Davis employees can buy discounted tickets for theÂ <a href="http://mondavi.ucdavis.edu/">Robert and Margrit Mondavi Center for the Performing Arts</a>.</p>

<h5>More Information</h5>

<ul><li><a href="https://frontdoor.ucdavis.edu/housing-resources">Housing Resources</a></li>
	<li><a href="https://frontdoor.ucdavis.edu/community-information">Davis Community Resources</a></li>
	<li><a href="http://staff.ucdavis.edu/">Staff Assembly</a></li>
	<li><a href="http://campusmap.ucdavis.edu/">Campus Map</a></li>
	<li><a href="https://sdps.ucdavis.edu/departments/benefits/dept-resources/abbrev">Quick guide to campus abbreviations</a></li>
</ul></div>
      
